import 'package:ollama_dart/ollama_dart.dart';
import 'package:test/test.dart';

// TODO split these tests into separate files grouped by API endpoint
void main() {
  group('Ollama Generate API tests', () {
    late OllamaClient client;
    late String modelCopyName;

    setUp(() {
      client = OllamaClient();
    });

    tearDown(() {
      client.endSession();
    });

    test('Ollama Client retrieves a list of local models', () async {
      final TagResponse tags = await client.listTags();
      expect(tags.models, isNotEmpty);
    });

    test('Ollama Client creates a copy of a local model', () async {
      final TagResponse tags = await client.listTags();
      print(tags);
      expect(
        tags.models,
        isNotEmpty,
        reason: 'there should be at least one local model to copy',
      );

      final Tag localModel = tags.models!.first;
      expect(
        localModel.name,
        isNotEmpty,
        reason: 'The local model should have a name',
      );

      modelCopyName = '${localModel.name}-backup';

      await client.copyModelWithResponse(
        request: CopyRequest(
          source: localModel.name!,
          destination: modelCopyName,
        ),
      );

      // final Response copyResponse = await client.copyModelWithResponse(
      //   request: CopyRequest(
      //     source: localModel.name!,
      //     destination: modelCopyName,
      //   ),
      // );
      // print(copyResponse.statusCode);

      final TagResponse updatedTags = await client.listTags();
      print(updatedTags);
      expect(updatedTags.models, isNotEmpty);
      expect(
        updatedTags.models!
            .where((final element) => element.name == modelCopyName)
            .toList(),
        isNotEmpty,
        reason:
            'the updated local model list should contain a model named $modelCopyName',
      );
    });

    test('Ollama Client deletes a local model', () async {
      final TagResponse tags = await client.listTags();
      print(tags);
      expect(
        tags.models,
        isNotEmpty,
        reason: 'there should be at least one local model to delete',
      );

      final Tag localBackup = tags.models!.firstWhere(
        (final element) {
          if (element.name?.contains('backup') ?? false) {
            return true;
          } else {
            return false;
          }
        },
        orElse: () => throw ArgumentError('should contain a backup to delete'),
      );
      expect(
        localBackup.name,
        isNotEmpty,
        reason: 'The local model should have a name',
      );

      await client.deleteModel(
        request: DeleteRequest(
          name: localBackup.name!,
        ),
      );

      // final Response response = await client.deleteModelWithResponse(
      //   request: DeleteRequest(name: localBackup.name!),
      // );
      // print(response.statusCode);

      final TagResponse updatedTags = await client.listTags();
      print(updatedTags);
      expect(updatedTags.models, isNotEmpty);
      expect(
        updatedTags.models!
            .where((final element) => element.name == localBackup.name)
            .toList(),
        isEmpty,
        reason:
            'the updated local model list should NOT contain a model named ${localBackup.name}',
      );
    });

    test('Ollama Client shows details of a local model', () async {
      final TagResponse tags = await client.listTags();
      print(tags);
      expect(
        tags.models,
        isNotEmpty,
        reason: 'there should be at least one local model to delete',
      );

      final Tag local = tags.models!.first;
      expect(
        local.name,
        isNotEmpty,
        reason: 'The local model should have a name',
      );

      final ShowResponse response = await client.showModel(
        request: ShowRequest(name: local.name!),
      );
      print(response);

      expect(
        response.modelfile,
        isNotEmpty,
        reason: 'The model should have modelfile information',
      );
      expect(
        response.parameters,
        isNotEmpty,
        reason: 'The model should have parameters for response generation',
      );
    });

    test('Ollama Client downloads a model from the Ollama servers', skip: true,
        () async {
      const String modelName = 'yarn-llama2:13b-128k-q4_1';

      final PullResponse response = await client.pullModel(
        request: const PullRequest(name: modelName, stream: false),
      );

      expect(response.status, equals(PullResponseStatus.success));

      // response.listen((PullResponse response) {
      //   if (response.status != null && response == PullResponseStatus.success) {
      //     print('finished pulling model: $modelName!!');
      //   } else {
      //     int completed = response.completed ?? 0;
      //     int total = response.total ?? 1;
      //     double finished = (completed.toDouble() / total.toDouble()) * 100;
      //     print(
      //       "$modelName: (${response.status ?? 'downloading'}) ${finished.toInt()}% [${"|" * finished.toInt()}] ${(total / 1024e3.toDouble()).toStringAsFixed(2)} GB",
      //     );
      //   }
      // });
    });

    test('Ollama Client creates a new local model', () async {
      const String modelName = 'mario';
      const String modelfile =
          'FROM mistral:latest\nSYSTEM You are mario from Super Mario Bros.';

      final CreateResponse response = await client.create(
        request: const CreateRequest(
          name: modelName,
          modelfile: modelfile,
          stream: false,
        ),
      );

      expect(
        response.status,
        equals(CreateResponseStatus.success),
        reason: 'Should return a list of values for the embedding',
      );
    });
  });
}

